CREATE DEFINER=`root`@`localhost` PROCEDURE `p_buscar_equipos`(

	in comando varchar(50),

    in buscar varchar(20)

)
BEGIN

	case comando

	  when 'Serie' then

		SELECT acs_sistema_viejo.equipos.placa,  acs_sistema_viejo.equipos.serie, acs_sistema_viejo.modelos_equipos.marca,acs_sistema_viejo.modelos_equipos.modelo,

		acs_sistema_viejo.tipos_equipos.tipo_equipo

		FROM  acs_sistema_viejo.equipos

		INNER JOIN acs_sistema_viejo.modelos_equipos on acs_sistema_viejo.equipos.codigo_modelo = acs_sistema_viejo.modelos_equipos.codigo_modelo

		INNER JOIN acs_sistema_viejo.tipos_equipos on acs_sistema_viejo.tipos_equipos.id_tipo = acs_sistema_viejo.modelos_equipos.id_tipo

		WHERE acs_sistema_viejo.equipos.serie = buscar;

	  when 'Placa' then 

		SELECT acs_sistema_viejo.equipos.placa,  acs_sistema_viejo.equipos.serie, acs_sistema_viejo.modelos_equipos.marca,acs_sistema_viejo.modelos_equipos.modelo,

		acs_sistema_viejo.tipos_equipos.tipo_equipo

		FROM  acs_sistema_viejo.equipos

		INNER JOIN acs_sistema_viejo.modelos_equipos on acs_sistema_viejo.equipos.codigo_modelo = acs_sistema_viejo.modelos_equipos.codigo_modelo

		INNER JOIN acs_sistema_viejo.tipos_equipos on acs_sistema_viejo.tipos_equipos.id_tipo = acs_sistema_viejo.modelos_equipos.id_tipo

		WHERE acs_sistema_viejo.equipos.placa = buscar;

	  end case;

END ;;
DELIMITER ;
